import HomeComponent from './../../containers/home'
import Head from "next/head";
import React from "react";
const Home = props => {

    return (
        <div>
            <Head>
                <title>Read Social</title>

            </Head>

            {props.map((item) => (
                <li key={item.id}>
                    {item.id} -- {item.name}
                </li>
            ))}
            {/*<HomeComponent/>*/}
        </div>
    )

}

export default Home;
